import '../App.css';
import React from "react";
import { useState } from "react";
import { useNavigate } from "react-router-dom";

const Show = () => {

    const navigate = useNavigate();

    const handleLogin = () => {
        navigate("/Show");
    };

    return (
        <div className="Containner-show">
            <div className='Div-butcon'>
            <button
                className='Button-styleCon'
            >
            Standing Contract
            </button>
            <button
                className='Button-styleCon'
            >
            Lying down Contract
            </button>
            </div>
        </div>
    );
};

export default Show;
